    //get the qrcode type by string length			
    let nType = 1;
    const length = sText.length; //qrc._getUTF8Length(sText);
    const limitLen = QRCodeLimitLength.length;
    for (let i = 0; i <= limitLen; i++) {
	    let nLimit = 0; //let nLimit = QRCodeLimitLen[i];// break;
		switch (nCorrectLevel) {
			case QRErrorCorrectLevel.L:
			    nLimit = QRCodeLimitLength[i][0]; break;
