				nLimit = QRCodeLimitLength[i][1]; break;
			case QRErrorCorrectLevel.Q:
				nLimit = QRCodeLimitLength[i][2]; break;
			case QRErrorCorrectLevel.H:
				nLimit = QRCodeLimitLength[i][3]; break;
        }
        if (length <= nLimit) {break;}
