            const nCount = QRCode.bank.qrcode.moduleCount;
            const context = canvas.getContext("2d");
            QRCode.clearCanvas(context);
			const nWidth = QRCode.bank.width / nCount;
			const nHeight = QRCode.bank.height / nCount;
			const nRoundedWidth = Math.round(nWidth);
			const nRoundedHeight = Math.round(nHeight);

            const colorDark = QRCode.bank.colorDark;
            const colorLight = QRCode.bank.colorLight;

			for (let row = 0; row < nCount; row++) {
				for (let col = 0; col < nCount; col++) {
					const bIsDark = QRCode.isDark(row, col);
					const nLeft = col * nWidth;
                    const nTop = row * nHeight;
                    const color = bIsDark ? colorDark : colorLight; 
					context.strokeStyle = color;
					context.lineWidth = 1;
					context.fillStyle = color;					
					context.fillRect(nLeft, nTop, nWidth, nHeight);

					context.strokeRect(
						Math.floor(nLeft) + 0.5,
						Math.floor(nTop) + 0.5,
						nRoundedWidth,
						nRoundedHeight
					);

					context.strokeRect(
						Math.ceil(nLeft) - 0.5,
						Math.ceil(nTop) - 0.5,
						nRoundedWidth,
						nRoundedHeight
					);
				}
			}
            QRCode.bank.isPainted = true;
            return canvas.toDataURL();
};

